import React, {useEffect, useState} from 'react';
import ReactDOM from 'react-dom'
import {BrowserRouter, Link, Route} from "react-router-dom";
import {Router, browserHistory, IndexRoute} from 'react-router'
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import logo from "./logo.svg";

export default function (props) {
    const [currentUserName, setCurrentUserName] = useState("default");
    const [currentUserUID, setCurrentUserUID] = useState("default");
    const [currentUserPassword, setCurrentUserPassword] = useState("default");

    useEffect(() => {
        fetch('session/dani').then(res => res.json().then(data => {
            setCurrentUserName(data[1].Username);
            setCurrentUserUID(data[1].UID)
            setCurrentUserPassword(data[1].Password)
        }))
    }, []);

    const index = document.getElementById('index')
    index.render(
        <div className="Index">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo"/>
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
                <p>{currentUserName}</p>
                <p>{currentUserUID}</p>
                <p>{currentUserPassword}</p>
            </header>
        </div>
    )
}


// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
